import React from 'react'
import Svg from './Svg'
export const SvgPin = ({size, title, desc, titleId, descId, ...props}) => (
  <Svg
    viewBox="0 0 24 24"
    height={size}
    width={size}
    fill="currentcolor"
    {...props}
  >
    {!!title && <title id={titleId}>{title}</title>}
    {!!desc && <desc id={descId}>{desc}</desc>}
    <path d="M12 2C8.1 2 5 5.1 5 9c0 5.2 7 13 7 13s7-7.8 7-13c0-3.9-3.1-7-7-7zm0 9.5c-1.4 0-2.5-1.1-2.5-2.5s1.1-2.5 2.5-2.5 2.5 1.1 2.5 2.5-1.1 2.5-2.5 2.5z" />
  </Svg>
)
SvgPin.isIcon = true
SvgPin.defaultProps = {
  size: 24,
  'aria-hidden': 'true',
  focusable: 'false',
  tabIndex: '-1'
}
export default SvgPin
